import React from "react";
import { Navbar } from "../../components/Navbar/Navbar";
import "./Favorites.scss";

export const Favorites: React.FC = () => {
  const favoriteRequests = localStorage.getItem("favorites")
    ? JSON.parse(localStorage.getItem("favorites")!)
    : null;

  return (
    <div className="searchResultsPageContainer">
      <Navbar />
      <div className="searchResultsContainer">
        <div className="searchResultsTitle">Favorites</div>
        <div className="favoritesContainer ">
          {favoriteRequests.map((request) => (
            <div className="favoriteRequest">{request}</div>
          ))}
        </div>
      </div>
    </div>
  );
};
